                  <foreignObject x="28" y="118" width="320" height="3248" id="BClm4wWvRCelWW5jLSbDAg" class="l--app- text" fill="#606266" pw:frame="28 118 320 3248">
                    <div xmlns="http://www.w3.org/1999/xhtml" class="html-text" style="font-size:12px;font-family:'PingFang SC',sans-serif;line-height:14px;text-align:justify;color:#606266">
                      <p> {$商家名称} APP（以下简称“ {$商家名称} ”）由 {$商家公司名称} 以（下简称“我们”)运营，我们依照以下注册协议向您提供本注册协议涉及的相关服务。请您使用 {$商家名称} 服务前仔细阅读本注册协议。您只有完全同意所有注册协议，才能成为 {$商家名称} 的用户（"用户"）并使用相应服务。</p>
                      <p>您在注册为 {$商家名称} 用户过程中点击"同意 {$商家名称} 用户注册协议"按钮即表示您已仔细阅读并明确同意遵守本注册协议以及经参引而并入其中的所有条款、政策以及指南，并受该等规则的约束（合称"本注册协议"）。</p>
                      <p>我们可能根据法律法规的要求或业务运营的需要，对本注册协议不时进行修改。除非另有规定，否则任何变更或修改将在修订内容于 {$商家名称} 发布之时立即生效，您对 {$商家名称} 的使用、继续使用将表明您接受此等变更或修改。如果您不同意本注册协议（包括我们可能不定时对其或其中引述的其他规则所进行的任何修改）的全部规定，则请勿使用 {$商家名称} 提供的所有服务，或您可以主动取消 {$商家名称} 提供的服务。</p>
                      <p>为了便于您了解适用于您使用 {$商家名称} 的条款和条件，我们将在 {$商家名称} 上发布我们对本注册协议的修改，您应不时地审阅本注册协议以及经参引而并入其中的对应规则。</p>
                      <p>一、服务内容</p>
                      <p>1.1<span style="font-family:'Lucida Grande',sans-serif"> </span> {$商家名称} 的具体服务内容由我们根据实际情况提供并不时更新，包括但不限于信息、图片、文章、评论、链接等，我们将定期或不定期根据用户的意愿以电子邮件、短信、电话或站内信等方式为用户提供活动信息，并向用户提供相应服务。我们对提供的服务拥有最终解释权。</p>
                      <p>1.2<span style="font-family:'Lucida Grande',sans-serif"> </span> {$商家名称} 服务仅供个人用户使用。除我们书面同意，您或其他用户均不得将 {$商家名称} 上的任何信息用于商业目的。</p>
                      <p>1.3<span style="font-family:'Lucida Grande',sans-serif"> </span>您使用 {$商家名称} 服务时所需的相关的设备以及网络资源等（如个人电脑、手机及其他与接入互联网或移动网有关的装置）及所需的费用（如为接入互联网而支付的电话费及上网费）均由您自行负担。</p>
                      <p>二、信息提供和隐私保护</p>
                      <p>2.1<span style="font-family:'Lucida Grande',sans-serif"> </span>您在访问、使用 {$商家名称} 或申请使用 {$商家名称} 服务时，必须提供本人真实的个人信息，且您应该根据实际变动情况及时更新个人信息。保护用户隐私是我们的重点原则，我们通过各种技术手段和强化内部管理等办法提供隐私保护服务功能，充分保护您的个人信息安全。</p>
                      <p>2.2<span style="font-family:'Lucida Grande',sans-serif"> </span> {$商家名称} 不负责审核您提供的个人信息的真实性、准确性或完整性，因信息不真实、不准确或不完整而引起的任何问题及其后果，由您自行承担，且您应保证我们免受由此而产生的任何损害或责任。若我们发现您提供的个人信息是虚假、不准确或不完整的，我们有权自行决定终止向您提供服务。</p>
                      <p>2.3<span style="font-family:'Lucida Grande',sans-serif"> </span>您已明确授权，为提供服务、履行协议、解决争议、保障交易安全等目的，我们对您提供的、我们自行收集的及通过第三方查询服务提供机构收集的您的个人信息、您申请服务时的相关信息、您在使用服务时储存在 {$商家名称} 的非公开内容以及您的其他个人资料（以下简称“个人资料”）享有留存、整理加工、使用和披露的权利，具体方式包括但不限于：：</p>
                      <p>（1）出于为您提供服务的需要在本APP公示您的个人资料；</p>
                      <p>（2）由人工或自动程序对您的个人资料进行获取、评估、整理、存储；</p>
                      <p>（3）使用您的个人资料以改进本APP的设计和推广；</p>
                      <p>（4）使用您提供的联系方式与您联络并向您传递有关服务和管理方面的信息；</p>
                      <p>（5）对您的个人资料进行分析整合并向为您提供服务的第三方提供为完成该项服务必要的信息；</p>
                      <p>（6）在您违反与我们或我们的其他用户签订的协议时，披露您的个人资料及违约事实，将您的违约信息写入黑名单并与必要的第三方共享数据，以供我们及第三方审核、追索之用。</p>
                      <p>（7）其他必要的使用及披露您个人资料的情形。</p>
                      <p>您已明确同意本条款不因您终止使用 {$商家名称} 服务而失效。如因我们行使本条款项下权利使您遭受损失，我们对该等损失免责。</p>
                      <p>您已明确授权查询服务提供机构及其关联公司及其指定的第三方可留存、整理及加工本次获取的您的信息用于查询服务提供机构及其关联公司及其指定的第三方为您提供的其他服务中。</p>
                      <p>2.4<span style="font-family:'Lucida Grande',sans-serif"> </span>为更好地为您提供服务，您同意并授权 {$商家名称} 、查询服务提供机构可与其合作的第三方进行联合研究，并可将通过本协议获得的您的信息投入到该等联合研究中。但 {$商家名称} 、查询服务提供机构与其合作的第三方在开展上述联合研究前，应要求其合作的第三方对在联合研究中所获取的您的信息予以保密。</p>
                      <p>2.5<span style="font-family:'Lucida Grande',sans-serif"> </span>为更好地为您提供服务，您理解并同意在您注册成为 {$商家名称} 会员时， {$商家名称} 有权调取并保存您的手机位置信息、通讯录、通话记录以及短信（包括但不限于短信内容、短信时间、发送对象等）等信息。另外，为使最终提供贷款服务的机构能够更准确地评估您的资信， {$商家名称} 会将该等调取的信息发送给该机构，用于您本次贷款资信评估。</p>
                      <p>2.6<span style="font-family:'Lucida Grande',sans-serif"> </span>若您曾经已经登陆过 {$商家名称} ，且已经授权 {$商家名称} 完成了相应的信息获取事宜，当您再次登陆 {$商家名称} ，并选择相关产品时，您授权 {$商家名称} 自动将之前授权获取的您的信息推送给为您提供金融服务的机构。</p>
                      <p>2.7<span style="font-family:'Lucida Grande',sans-serif"> </span>我们保证采用行业惯例以保护您的资料，但您理解，鉴于技术限制，我们无法确保用户的个人信息完全不被泄露。</p>
                      <p>2.8<span style="font-family:'Lucida Grande',sans-serif"> </span>我们不会向与您无关的第三方恶意出售或免费提供您的个人资料，但下列情况除外：</p>
                      <p>（1）事先获得您的明确授权；</p>
                      <p>（2）按照相关司法机构或政府主管部门的要求；</p>
                      <p>（3）以维护我们合法权益之目的；</p>
                      <p>（4）维护社会公众利益；</p>
                      <p>（5）为确保 {$商家名称} 业务和系统的完整与操作。</p>
                      <p>（6）符合其他合法要求。</p>
                      <p>三、使用准则</p>
                      <p>3.1<span style="font-family:'Lucida Grande',sans-serif"> </span>您在使用 {$商家名称} 服务过程中，必须遵循国家的相关法律法规，不通过 {$商家名称} 发布、复制、上传、散播、分发、存储、创建或以其它方式公开含有以下内容的信息：</p>
                      <p>(1)<span style="font-family:'Lucida Grande',sans-serif"> </span>反对宪法所确定的基本原则的；</p>
                      <p>(2)<span style="font-family:'Lucida Grande',sans-serif"> </span>危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；</p>
                      <p>(3)<span style="font-family:'Lucida Grande',sans-serif"> </span>损害国家荣誉和利益的；</p>
                      <p>(4)<span style="font-family:'Lucida Grande',sans-serif"> </span>煽动民族仇恨、民族歧视，破坏民族团结的；</p>
                      <p>(5)<span style="font-family:'Lucida Grande',sans-serif"> </span>破坏国家宗教政策，宣扬邪教和封建迷信的；</p>
                      <p>(6)<span style="font-family:'Lucida Grande',sans-serif"> </span>散布谣言，扰乱社会秩序，破坏社会稳定的；</p>
                      <p>(7)<span style="font-family:'Lucida Grande',sans-serif"> </span>散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的、欺诈性的或以其它令人反感的讯息、数据、信息、文本、音乐、声音、照片、图形、代码或其它材料；</p>
                      <p>(9)<span style="font-family:'Lucida Grande',sans-serif"> </span>其他违反宪法和法律、行政法规或规章制度的；</p>
                      <p>(10)<span style="font-family:'Lucida Grande',sans-serif"> </span>可能侵犯他人的专利、商标、商业秘密、版权或其它知识产权或专有权利的内容；</p>
                      <p>(11)<span style="font-family:'Lucida Grande',sans-serif"> </span>假冒任何人或实体或以其它方式歪曲您与任何人或实体之关联性的内容；</p>
                      <p>(12)<span style="font-family:'Lucida Grande',sans-serif"> </span>未经请求而擅自提供的促销信息、政治活动、广告或意见征集；</p>
                      <p>(13)<span style="font-family:'Lucida Grande',sans-serif"> </span>任何第三方的私人信息，包括但不限于地址、电话号码、电子邮件地址、身份证号以及信用卡卡号；</p>
                      <p>(14)<span style="font-family:'Lucida Grande',sans-serif"> </span>病毒、不可靠数据或其它有害的、破坏性的或危害性的文件；</p>
                      <p>(15)<span style="font-family:'Lucida Grande',sans-serif"> </span>与内容所在的互动区域的话题不相关的内容；</p>
                      <p>(16)<span style="font-family:'Lucida Grande',sans-serif"> </span>依我们的自行判断，足以令人反感的内容，或者限制或妨碍他人使用或享受互动区域或 {$商家名称} 的内容，或者可能使我们或我们关联方或其他用户遭致任何类型损害或责任的内容；</p>
                      <p>(17)<span style="font-family:'Lucida Grande',sans-serif"> </span>包含法律或行政法规禁止内容的其他内容。</p>
                      <p>3.2<span style="font-family:'Lucida Grande',sans-serif"> </span>用户不得利用 {$商家名称} 的服务从事下列危害互联网信息网络安全的活动：</p>
                      <p>(1)<span style="font-family:'Lucida Grande',sans-serif"> </span>未经允许，进入互联网信息网络或者使用互联网信息网络资源；</p>
                      <p>(2)<span style="font-family:'Lucida Grande',sans-serif"> </span>未经允许，对互联网信息网络功能进行删除、修改或者增加；</p>
                      <p>(3)<span style="font-family:'Lucida Grande',sans-serif"> </span>未经允许，对进入互联网信息网络中存储、处理或者传输的数据和应用程序进行删除、修改或者增加；</p>
                      <p>(4)<span style="font-family:'Lucida Grande',sans-serif"> </span>故意制作、传播计算机或手机病毒等破坏性程序；</p>
                      <p>(5)<span style="font-family:'Lucida Grande',sans-serif"> </span>其他危害互联网信息网络安全的行为。</p>
                      <p>3.3<span style="font-family:'Lucida Grande',sans-serif"> </span>我们保留在任何时候为任何理由而不经通知地过滤、移除、筛查或编辑本APP上发布或存储的任何内容的权利，您须自行负责备份和替换在本APP发布或存储的任何内容，成本和费用自理。</p>
                      <p>3.4<span style="font-family:'Lucida Grande',sans-serif"> </span>您须对自己在使用 {$商家名称} 服务过程中的行为承担法律责任。若您为限制行为能力或无行为能力者，则您的法定监护人应承担相应的法律责任。</p>
                      <p>3.5<span style="font-family:'Lucida Grande',sans-serif"> </span>如您的操作影响系统总体稳定性或完整性，我们将暂停或终止您的操作，直到相关问题得到解决。</p>
                      <p>四、免责声明</p>
                      <p>4.1<span style="font-family:'Lucida Grande',sans-serif"> </span> {$商家名称} 是一个开放平台，用户将文章或照片等个人资料上传到互联网上，有可能会被其他组织或个人复制、转载、擅改或做其它非法用途，用户必须充分意识此类风险的存在。作为网络服务的提供者，我们对用户在任何论坛、个人主页或其它互动区域提供的任何陈述、声明或内容均不承担责任。您明确同意使用 {$商家名称} 服务所存在的风险或产生的一切后果将完全由您自身承担，我们对上述风险或后果不承担任何责任。</p>
                      <p>4.2<span style="font-family:'Lucida Grande',sans-serif"> </span>您违反本注册协议、违反道德或法律的，侵犯他人权利（包括但不限于知识产权）的，我们不承担任何责任。同时，我们对任何第三方通过 {$商家名称} 发送服务或包含在服务中的任何内容不承担责任。</p>
                      <p>4.3<span style="font-family:'Lucida Grande',sans-serif"> </span>对您、其他用户或任何第三方发布、存储或上传的任何内容或由该等内容导致的任何损失或损害，我们不承担责任。</p>
                      <p>4.4<span style="font-family:'Lucida Grande',sans-serif"> </span>对任何第三方通过 {$商家名称} 可能对您造成的任何错误、中伤、诽谤、诬蔑、不作为、谬误、淫秽、色情或亵渎，我们不承担责任。</p>
                      <p>4.5<span style="font-family:'Lucida Grande',sans-serif"> </span>对黑客行为、计算机或手机病毒、或因您保管疏忽致使帐号、密码被他人非法使用、盗用、篡改的或丢失，或由于与本APP站链接的其它网站或APP所造成您个人资料的泄露，或您因其他非 {$商家名称} 原因造成的损失，我们不承担责任。如您发现任何非法使用用户帐号或安全漏洞的情况，请立即与我们联系。</p>
                      <p>4.6<span style="font-family:'Lucida Grande',sans-serif"> </span>因任何非 {$商家名称} 原因造成的网络服务中断或其他缺陷，我们不承担任何责任。</p>
                      <p>4.7<span style="font-family:'Lucida Grande',sans-serif"> </span>我们不保证服务一定能满足您的要求；不保证服务不会中断，也不保证服务的及时性、安全性、准确性。</p>
                      <p>4.8<span style="font-family:'Lucida Grande',sans-serif"> </span>任何情况下，因使用 {$商家名称} 而引起或与使用 {$商家名称} 有关而产生的由我们负担的责任总额，无论是基于合同、保证、侵权、产品责任、严格责任或其它理论，均不得超过您因访问或使用本APP而向我们支付的任何服务费用。</p>
                      <p>4.9<span style="font-family:'Lucida Grande',sans-serif"> </span> {$商家名称} 提供免费的贷款搜索和推荐服务，贷款过程中遇到的任何预先收费均为诈骗行为，请保持警惕避免损失。</p>
                      <p>五、服务变更、中断或终止</p>
                      <p>5.1<span style="font-family:'Lucida Grande',sans-serif"> </span>如因升级的需要而需暂停服务、或调整服务内容，我们将尽可能在APP上进行通告。由于用户未能及时浏览通告而造成的损失，我们不承担任何责任。</p>
                      <p>5.2<span style="font-family:'Lucida Grande',sans-serif"> </span>您明确同意，我们保留根据实际情况随时调整 {$商家名称} 提供的服务内容、种类和形式，或自行决定授权第三方向您提供原本我们提供的服务。因业务调整给您或其他用户造成的损失，我们不承担任何责任。同时，我们保留随时变更、中断或终止 {$商家名称} 全部或部分服务的权利。</p>
                      <p>5.3<span style="font-family:'Lucida Grande',sans-serif"> </span>发生下列任何一种情形，我们有权单方面中断或终止向您提供服务而无需通知您，且无需对您或第三方承担任何责任：</p>
                      <p>(1)<span style="font-family:'Lucida Grande',sans-serif"> </span>您提供的个人资料不真实；</p>
                      <p>(2)<span style="font-family:'Lucida Grande',sans-serif"> </span>您违反本注册协议；</p>
                      <p>(3)<span style="font-family:'Lucida Grande',sans-serif"> </span>未经我们书面同意，将 {$商家名称} 平台用于商业目的。</p>
                      <p>5.4<span style="font-family:'Lucida Grande',sans-serif"> </span>您可随时通知我们终止向您提供服务或直接取消 {$商家名称} 服务。自您终止或取消服务之日起，我们不再向您承担任何形式的责任。</p>
                      <p>六、特别约定</p>
                      <p>6.1<span style="font-family:'Lucida Grande',sans-serif"> </span>您使用本服务的行为若有任何违反国家法律法规或侵犯任何第三方的合法权益的情形时，我们有权直接删除该等违反规定之信息，并可以暂停或终止向您提供服务。</p>
                      <p>6.2<span style="font-family:'Lucida Grande',sans-serif"> </span>若您利用 {$商家名称} 服务从事任何违法或侵权行为，由您自行承担全部责任，因此给我们或任何第三方造成任何损失，您应负责全额赔偿，并使我们免受由此产生的任何损害。</p>
                      <p>6.3<span style="font-family:'Lucida Grande',sans-serif"> </span>您同意我们通过重要页面的公告、通告、电子邮件以及常规信件的形式向您传送与 {$商家名称} 服务有关的任何通知和通告。</p>
                      <p>6.4<span style="font-family:'Lucida Grande',sans-serif"> </span>本注册协议之效力、解释、执行均适用中华人民共和国法律。</p>
                      <p>6.5<span style="font-family:'Lucida Grande',sans-serif"> </span>若非 {$商家名称} 更新本协议，您再确认同意、签署本协议后，其效力将及于您此时及未来登陆 {$商家名称} 时所有操作。</p>
                      <p>6.6<span style="font-family:'Lucida Grande',sans-serif"> </span>您在本协议项下对本公司的授权将视为对本公司及本公司之关联公司的授权。本公司及本公司关联公司均可凭借您的授权及本协议约定执行相关操作。</p>
                      <p>6.7<span style="font-family:'Lucida Grande',sans-serif"> </span>如就本协议内容或其执行发生任何争议，应尽量友好协商解决；协商不成时，任何一方均可向 {$商家公司名称} 所在地的人民法院提起诉讼。</p>
                      <p>6.8<span style="font-family:'Lucida Grande',sans-serif"> </span>本注册协议中的标题仅为方便而设，不影响对于条款本身的解释。本注册协议最终解释权归 {$商家公司名称} 所有。</p>

                  <foreignObject x="35" y="93" width="306" height="993" id="xO8v3gVAS6GZ8COA9jSuGA" class="l-q--a- text" fill="#606266" pw:frame="35 93 306 993">
                    <div xmlns="http://www.w3.org/1999/xhtml" class="html-text" style="font-size:16px;font-family:'PingFang SC',sans-serif;line-height:24px;color:#606266">
                      <p>Q: 什么是小蓝钱包？</p>
                      <p>A: 【小蓝钱包】是一款联结借款客户与金融贷款结构的金融信息中介平台，我们旨在帮助贷款用户匹配到方便、优质、优惠的信贷产品。</p>
                      <p>&nbsp;</p>
                      <p>Q: 在小蓝钱包平台上借款会泄露个人信息吗？</p>
                      <p>A: 根据监管法规规定，【小蓝钱包】不能将用户个人信息泄露给第三方机构。所以大家不用担心信息泄露</p>
                      <p>&nbsp;</p>
                      <p>Q: 为什么有的产品会人数已满</p>
                      <p>A: 每个产品都有每天申请人数的限制，每天0:00开始申请，各个产品限制上限不同。若您想要申请的产品当天人数已满，您可以隔天继续尝试或者查看其它产品。</p>
                      <p>&nbsp;</p>
                      <p>Q: 取消贷款</p>
                      <p>A: 我想取消贷款怎么操作？</p>
                      <p>不绑定银行卡就不会放款，也不会产生费用。绑定银行卡进入审核后，不可取消。</p>
                      <p>&nbsp;</p>
                      <p>Q: 申请不了贷款, 选择不了联系人怎么办？</p>
                      <p>A: 若提示联系人非法，则是手机号或者联系人中出现了非法的字符:手机号中不能出现非数字的字符（如+、空格等）、联系人姓名中不能出现非汉字的字符（如英文字母、标点符号等）。</p>
                      <p>若获取联系人时没反应、出现空白页或者联系人不全，则是您的手机未给派大薪app开启通讯录权限，请您在“设置”中进行设置，具体设置方法请参考您手机的说明。</p>
                      <p>&nbsp;</p>
                      <p>Q: 我是老用户，结清后再申请能否提额？提额多少</p>
                      <p>&nbsp;</p>
                      <p>A: 按时还款，结清后再申请可以享受免审、提额、降息的优惠。提额、降息的幅度都是由系统根据您的借还款表现计算给出的。保持良好的信用有助于额度提升哦</p>
                    </div>
                  </foreignObject>
                </g>
              </g>
